import React from 'react';
import ProjData1 from './Components/ProjData1';
import ProjCard1 from './Components/ProjCard1';
const Project = ()=>{
    return(
        <>
        <br/>
        <br/>
         <div className="my-5 prj-p">
         <h4 className='text-center'>Some of my Recent Works</h4>
             <h2 className="text-center" >Projects</h2>
     </div>
     
        <div className="container-fluid mb-5 mx-auto">
            <div className="row mx-auto">
           
                <div className="col-10 mx-auto">
                <div className='searchbar  mx-auto'>
                    <form>
                    <input type='text' placeholder='Project Name' className='form-control' />
                    </form>
                </div>
                <div className="row gy-1 mx-auto">
               {ProjData1.map((val,index)=>{
                   return<ProjCard1
                       key={index}
                       id={index}
                       imgsrc={val.imgsrc}
                       link={val.link}
                       title={val.title}
                       text={val.text}
                   />
               })}
                   
                </div> 
                </div>
            </div>
        </div>
        
        </>
    );
};
export default Project;
